import React from "react";
import styles from './style.module.css'

const Header = () => {
  return (
    <div className={styles.wrapper}>
      <div className='container mx-auto'>
          <img className='max-w-xs' src='/logo_palpitebox.png' alt='PalpiteBox' />
      </div>
    </div>
  );
};

export default Header
